    function cf_getPadding(p) {
        if (is_undefined(p)) {
            return [0, 0, 0, 0];
        }
        if (is_number(p)) {
            return [p, p, p, p];
        }
        if (is_string(p)) {
            p = p.split('px').join('').split('em').join('').split(' ');
        }
        if (!is_array(p)) {
            return [0, 0, 0, 0];
        }
        for (var i = 0; i < 4; i++) {
            p[i] = parseInt(p[i], 10);
        }
        switch (p.length) {
            case 0:
                return [0, 0, 0, 0];
            case 1:
                return [p[0], p[0], p[0], p[0]];
            case 2:
                return [p[0], p[1], p[0], p[1]];
            case 3:
                return [p[0], p[1], p[2], p[1]];
            default:
                return [p[0], p[1], p[2], p[3]];
        }
    }

